  doc.setTextColor("blue")
  doc.textWithLink(`: ${pdfData.transactionId.slice(0,20)}...(View on Solscan)`,  x+40, 190,{url:`https://solscan.io/tx/${pdfData.transactionId}?cluster=devnet`});
  doc.setTextColor("black")
    
